import axios from "axios";
import { useState, useEffect } from "react";

const ComicDetails = ({ resourceURI, comicName }) => {
  const [comicDetails, setComicDetails] = useState("");
  console.log("comicDetails:", comicDetails);
  useEffect(() => {
    const url = { resourceURI };
    console.log("url: ", url.resourceURI);
    axios
      .get(url.resourceURI)
      .then((response) => {
        console.log("comic response", response);
        console.log("comicss: ", response.data.data.results[0].creators.items);
        setComicDetails(response.data.data.results[0].creators.items);
      })
      .catch((error) => {
        console.log("Error marvel: ", error);
      });
  }, []);

  return (
    <div>
      {comicName.map((comicname) => (
        <div>
          <h2>{comicname.name}</h2>
        </div>
      ))}
    </div>
  );
};

